import React from 'react'
import {NavLink} from "react-router-dom";
import classes from '../Nav/Nav.module.css'
import { connect } from 'react-redux'
import {ChangeUrl} from '../../../redux/NavReducer'


const NavCategory = (props) =>{

	return <section className={classes.section}>
		<div className={classes.Menu}><div className={classes.Menu_text}>category options</div></div>
		<nav className={classes.block}>
	        <NavLink to="/surfapparel/men" activeClassName={classes.activeLink} className={classes.Link} 
	        	onClick={() => {props.ChangeUrl(Category,men)}}> <div className={classes.divfirst}>men</div></NavLink>
	        <NavLink to="/surfapparel/women" activeClassName={classes.activeLink} className={classes.Link} 
	        	onClick={() => {props.ChangeUrl(Category,women)}}> <div className={classes.div}>women</div></NavLink>
	        <NavLink to="/surfapparel/kids" activeClassName={classes.activeLink} className={classes.Link} 
	        	onClick={() => {props.ChangeUrl(Category,kids)}}> <div className={classes.div}>kids</div></NavLink>
	        <NavLink to="/surfapparel/wetsuits" activeClassName={classes.activeLink} className={classes.Link} 
	        	onClick={() => {props.ChangeUrl(Category,wetsuits)}}> <div className={classes.div}>wetsuits</div></NavLink>
	        <NavLink to="/surfapparel/outerwear" activeClassName={classes.activeLink} className={classes.Link} 
	        	onClick={() => {props.ChangeUrl(Category,outerwear)}}> <div className={classes.divend}>outerwear</div></NavLink>
        </nav>
	</section>

}
const mapStateToProps = (state) => {
    return{
    	ActivePage:state.Products.ActivePageFromSurfApparel,
    	SurfProduct:state.Products.SurfProduct,
    	LengthSurfApparel:state.Products.LengthSurfApparel,
    	Messegers:state.Instagram.Messegers
    }
}

export default connect(mapStateToProps,{ChangeUrl})(NavCategory)
